import React from 'react'
import { makeStyles } from '@material-ui/styles';
import { Grid } from '@material-ui/core';
import { useDispatch, useSelector } from 'react-redux'
import {  RestaurantServings } from '../../actions/RestaurantActions';
function DonateScreen(props) {
    const dispatch = useDispatch()
    const restaurantServings = useSelector(state=>state.restaurantServings)
    console.log(restaurantServings)

    React.useEffect(()=>{
           dispatch(RestaurantServings(props.match.params.id))
    },[dispatch])

     const useStyles = makeStyles(theme => ({
         title:{
            ...theme.typography.content, 
            textAlign:'center',
            fontSize:'3rem'

         }
     }))
     const classes = useStyles()
    return (
        <div>
            <h1 className={classes.title} >Donate for the needy</h1>
            <Grid xs={12} container >
                <Grid item xs={12} md={3} >

                </Grid>
            </Grid>
        </div>
    )
}

export default DonateScreen
